import React, { Component } from 'react';

class Products extends Component {
    constructor(props) {
        super(props);
        this.state = {
          product: null,
        };
      }
      render() { 
        return ( 
        <div>
            <ul>
            {this.props.Products.map(product =>(
                <li href="#" key={product.id}>
                <img src={product.image} alt={product.title} />
                <h4>{product.title}</h4>
                </li>
            ))}
            </ul>
        </div> );
    }
}
 
export default Products;
